func TestVerifyFinality(t *testing.T) {
	err := verifyFinalityV2(&update)
	assert.Nil(t, err)
}

func TestVerifyNextSyncCommittee(t *testing.T) {
	data, err := hexutil.Decode(INPUT)
	assert.Nil(t, err)

	verify, err := decodeLightClientVerify(data)
	assert.Nil(t, err)

	err = verifyNextSyncCommittee(verify.state, verify.update)
	assert.Nil(t, err)
}

func TestVerifyBlsSignatures(t *testing.T) {
	err := verifyBlsSignatures(&state, &update)
	assert.Nil(t, err)
}

func TestDecodeLightClientVerify(t *testing.T) {
	data, err := hexutil.Decode(INPUT)
	assert.Nil(t, err)

	verify, err := decodeLightClientVerify(data)
	assert.Nil(t, err)

	assert.Equal(t, update.attestedHeader, verify.update.GetAttestedHeader())
	assert.Equal(t, update.nextSyncCommittee, verify.update.GetNextSyncCommittee())
	assert.Equal(t, update.nextSyncCommitteeBranch, verify.update.GetNextSyncCommitteeBranch())
	assert.Equal(t, update.finalizedHeader, verify.update.GetFinalizedHeader())
	assert.Equal(t, update.finalityBranch, verify.update.GetFinalityBranch())
	root, err := update.finalizedExecution.HashTreeRoot()
	assert.Nil(t, err)
	treeRoot, err := verify.update.(*LightClientUpdateV2).finalizedExecution.HashTreeRoot()
	assert.Nil(t, err)
	assert.Equal(t, root, treeRoot)
	assert.Equal(t, update.executionBranch, verify.update.(*LightClientUpdateV2).executionBranch)
	assert.Equal(t, update.syncAggregate, verify.update.GetSyncAggregate())
	assert.Equal(t, update.signatureSlot, verify.update.GetSignatureSlot())
	assert.Equal(t, state, *verify.state)
}

func TestVerifyLightClientUpdate(t *testing.T) {
	data, err := hexutil.Decode(INPUT)
	assert.Nil(t, err)

	err = VerifyLightClientUpdate(data)
	assert.Nil(t, err)
}
